import React, { useEffect, useState} from 'react';
import { Link, useHistory } from 'react-router-dom';
import styled from 'styled-components';

const Styles = styled.div`
background:#fff;
`;

function Home() {
    return(
        <React.Fragment>
            <Styles>
            this is Home page
            </Styles>
        </React.Fragment>
    )
}

export default Home;
